import React, { useState } from 'react';
import { useForm } from 'react-hook-form';
import { GoogleMap, LoadScript, Marker } from '@react-google-maps/api';

function App() {
  const { register, handleSubmit, setValue } = useForm();
  const [location, setLocation] = useState({ lat: -23.5505, lng: -46.6333 }); // Coordenadas iniciais 
  const googleApiKey = "AIzaSyD8OZEHbRuZSeWDRE4X4Ls5dHCCv46C-nk"; // chave da API do Google

  const checkCEP = (e) => {
    const cep = e.target.value.replace(/\D/g, '');
    if (cep.length !== 8) {
      console.log("CEP inválido.");
      return;
    }

    fetch(`https://viacep.com.br/ws/${cep}/json/`)
      .then(res => res.json())
      .then(data => {
        if (data.erro) {
          console.log("CEP não encontrado.");
          return;
        }
        setValue('address', data.logradouro);
        setValue('neighborhood', data.bairro);
        setValue('city', data.localidade);
        setValue('uf', data.uf);

        return fetch(`https://maps.googleapis.com/maps/api/geocode/json?address=${cep},BR&key=${googleApiKey}`);
      })
      .then(res => res && res.json())
      .then(data => {
        if (data && data.status === "OK") {
          const lat = data.results[0].geometry.location.lat;
          const lng = data.results[0].geometry.location.lng;
          setLocation({ lat, lng });
        }
      })
      .catch(err => console.error("Erro na requisição:", err));
  };

  return (
    <LoadScript googleMapsApiKey={googleApiKey}>
      <div style={{ maxWidth: '600px', margin: 'auto' }}>
        <form onSubmit={handleSubmit(data => console.log(data))} style={{ display: 'flex', flexDirection: 'column', gap: '10px',  }}>
          <label>
          CEP:
           
          </label>
          <input type="text" {...register("cep")} onBlur={checkCEP} />
          
          <button type="submit">Enviar</button>
        <GoogleMap
          mapContainerStyle={{  width: '100%', height: '400px', marginTop: '20px', marginLeft: 'auto', marginRight: 'auto' }}
          center={location}
          zoom={15}
        >
          <Marker position={location} />
        </GoogleMap>
        <div style={{ display: 'flex', justifyContent: 'space-between' }}>
            <div style={{ display: 'flex', flexDirection: 'column', gap: '10px' }}>
              <label>
                Rua:
                <input type="text" {...register("address")} style={{ backgroundColor: 'transparent', border: 'none', outline: 'none', caretColor: 'black' }} />
              </label>
              <label>
                Bairro:
                <input type="text" {...register("neighborhood")} style={{ backgroundColor: 'transparent', border: 'none', outline: 'none', caretColor: 'black' }} />
              </label>
            </div>
            <div style={{ display: 'flex', flexDirection: 'column', gap: '10px' }}>
              <label>
                Cidade:
                <input type="text" {...register("city")} style={{ backgroundColor: 'transparent', border: 'none', outline: 'none', caretColor: 'black' }} />
              </label>
              <label>
                Estado:
                <input type="text" {...register("uf")} style={{ backgroundColor: 'transparent', border: 'none', outline: 'none', caretColor: 'black' }} />
              </label>
            </div>
          </div>
        </form>
      </div>
      <div style={{}}>
        <a href='/contatos'>Contatos</a>
      </div>

    </LoadScript>
  );
}


export default App;
